import React from "react";
import Form from "react-bootstrap/Form";

function Search(props) {
  return(
    <div>
      <Form.Row>
        <Form.Control />
      </Form.Row>
      <input type="text" placeholder="Search" value={props.search} onChange={(event) => props.setSearch(event.target.value)}/>
    </div>
  )
}

export default Search;
